DROP TRIGGER IF EXISTS series_insert;
delimiter //
CREATE TRIGGER series_insert BEFORE INSERT ON series
FOR EACH ROW
BEGIN 
	IF NOT(SELECT use_series FROM nomenclature_types WHERE id = NEW.nomenclature_type_id) THEN 
		SET new.nomenclature_type_id = (SELECT id FROM nomenclature_types WHERE use_series = use_series LIMIT 1); 
	END IF;
END; //
delimiter ;



DROP TRIGGER IF EXISTS series_insert;
delimiter //
CREATE TRIGGER series_insert BEFORE INSERT ON series
FOR EACH ROW
BEGIN 
	IF NOT(SELECT use_series FROM nomenclature_types WHERE id = New.nomenclature_type_id) THEN SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'series off'; END IF;
END; //
delimiter ;

